import './App.css';

function App() {
  return (  
    <div className="App">
        <div class='main-grid'>
            <div class='left-navbar-area'>
              <nav class='left-navbar'>
                  <ul>
                    <li></li>
                  </ul>
              </nav>
            </div>
            <div class='account-bar-area'></div>
            <div class='music-area'></div>
            <div class='player-area'></div>
        </div>
    </div>
  );
}

export default App;
